import React from "react";
import s from './ProfileInfo.module.css';

const ProfileInfo = () => {
    return (
        <div>
            <div >
                <img  className={s.img}
                    src='https://www.wallpapertip.com/wmimgs/134-1347040_cyberspace-lines-network-connection-cyberspace.jpg'/>
            </div>
            <div className={s.descriptionBlock}>
                ava + description
            </div>
        </div>
    )
}

export default ProfileInfo;
